var question = []; // create empty array

// create question objects and store them in the array
question[0] = { 
     questionText: "Do you have a mullet?",
     answers:
          [               
               { response: "Yes", nextQuestion: 1 },
               { response: "No", nextQuestion: 2 }
          ]
}
     question[1] = { 
          questionText: "Motorcycle or Mountain Bike?",
          answers:
               [
                    { response: "Motorcycle", nextQuestion: 100 },
                    { response: "Mountain Bike", nextQuestion: 100 }
               ]
     }
     question[2] = { 
          questionText: "When do you shower?",
          answers:
               [
                    { response: "Morning", nextQuestion: 100 },
                    { response: "Evening", nextQuestion: 100 },
                    { response: "Never", nextQuestion: 100 }
               ]
     }
     
     



question[100] = { 
     questionText: "THIS IS FILLER FOR THE END OF THE GAME",
     answers:
          [
               { response: "Start over", nextQuestion: 3 }               
          ]
}


export default question;
